import Module from "./runCommands";

const ctx: Worker = self as any;

const appendPtr = Module.addFunction((stringPtr: number, isUTF8: number) => {
	ctx.postMessage({
		charToAppend: isUTF8 ? Module.UTF8ToString(stringPtr) : Module.UTF32ToString(stringPtr)
	});
});

const inputDisabledPtr = Module.addFunction((isInputDisabled: number) => {
	ctx.postMessage({
		isInputDisabled: Boolean(isInputDisabled)
	});
});

const exitPtr = Module.addFunction((errorMessagePtr: number) => {
	ctx.postMessage({
		errorMessage: Module.UTF8ToString(errorMessagePtr)
	});
});

ctx.onmessage = e => {
	if (e.data.commands) {
		const typedCommands = new Uint8Array(e.data.commands);

		const cmdPtr = Module._malloc(typedCommands.length * typedCommands.BYTES_PER_ELEMENT);
		Module.HEAPU8.set(typedCommands, cmdPtr);

		let bytesToWrite = 0;
		let utf32Input = null;

		if (e.data.input !== undefined) {
			bytesToWrite = Module.lengthBytesUTF32(e.data.input);
			utf32Input = Module._malloc(bytesToWrite + 4);

			Module.stringToUTF32(e.data.input, utf32Input, bytesToWrite + 4);
		}

		const index = bytesToWrite / 4;

		Module._runCommands(cmdPtr, e.data.commands.length, utf32Input!, index, appendPtr, inputDisabledPtr, exitPtr);
		Module._free(cmdPtr);

		if (e.data.input !== undefined) {
			Module._free(utf32Input!);
		}
	}
};
